function parseXEC(a,b='',c=' '){d=false;a.split('.').length==1?d=true:a.split('.').slice(1).forEach((x)=>{if(isNaN(parseInt(x)))d=true});return d?encodeXEC(a,b):decodeXEC(a,c)}function encodeXEC(a,b=''){c='';b=b.split('').map((x)=>x.charCodeAt(0)).reduce((y,x)=>y+x,0);a.split('').forEach((x)=>{x=x.charCodeAt(0)+b;d=Math.floor(Math.random()*x/3*2)+1;e=Math.floor(Math.random()*(x-d))+1;f=x-d-e;c+=`.${d}.${e}.${f}`});return c}function decodeXEC(a,b=' '){a=a.split('.').slice(1).map((x)=>parseInt(x)),c=[],d=0,e={},f=0;if(a.length%3!=0)return;for(i=0;i<a.length;i+=3)c.push(a[i]+a[i+1]+a[i+2]);c.forEach((x)=>{e[x]=(e[x]||0)+1;if(e[x]>f)f=e[x],d=x});return String.fromCharCode(...c.map((x)=>{return x-d+b.charCodeAt(0)}))}
